import ResponsiveVideoPlayer from './components/ResponsiveVideoPlayer';
import VideoTrimmer from './components/VideoTrimmer';

function App() {
  return (
    <div className="App">
      <ResponsiveVideoPlayer videoUrl="https://media.w3.org/2010/05/sintel/trailer.mp4" />
      <VideoTrimmer videoDuration={60} />
    </div>
  );
}

export default App;
